INSERT INTO `email_notifications` VALUES ('answer_wrong_borrower','Warning, unsuccessful attempts','[LOGO] Dear [username],<br><br>You have entered 3 unsuccessful  wrong security answer attempt. kindly send an email to admin to reset password.<br> sincerely,<br><br>[application_name]'),('answer_wrong_investor','Warning, unsuccessful attempts','[LOGO] Dear [username],<br><br>You have entered 3 unsuccessful  wrong security answer attempt. kindly send an email to admin to reset password.<br> sincerely,<br><br>[application_name]'),('borrower_bank_approved','New Bank Information Updated','[LOGO]Dear [borrower_contact_person],<br><br>The Bank information update that you had initiated on [application_name] has now been successfully approved.<br>sincerely,<br>Team [application_name]<br>.'),('borrower_bank_change_approved','Borrower bank has been Changed ','[LOGO]Dear [borrower_contact_person],<br><br>The Bank information update that you had initiated on [application_name]  has been successfully approved.<br>sincerely,<br>Team [application_name]<br>.'),('borrower_bank_reject','Borrower bank has been Rejected','[LOGO]Dear [borrower_contact_person],<br><br>We refer to your application for registered as an active bank at [application_name]. We are sorry to inform you that your bank has been rejected. Please get in touch with our Customer Service team over email for more information.<br>sincerely,<br>Team [application_name]<br>'),('borrower_profile_approved','Your Profile has been approved.','[LOGO]Dear [borrower_contact_person],<br><br>We refer to your application has now been approved. You can now login view the all screens..<br>sincerely,<br>Team [application_name]<br>'),('borrower_profile_inactive','Profile Inactive','[LOGO]Dear [borrower_contact_person],<br><br>We refer to your application for registering as an investor at [application_name]. We have deactivated your account for administrative reasons. Please get in touch with our Customer Service team over email for more information.<br>sincerely,<br>Team [application_name]<br>'),('borrower_profile_reject','Profile Rejected','[LOGO]Dear [borrower_contact_person],<br><br>We refer to your application for registering as an borrower at [application_name]. We are sorry to inform you that your profile has been rejected. Please get in touch with our Customer Service team over email for more information.<br>sincerely,<br>Team [application_name]<br>'),('borrower_profile_return_to_borrower','Changes required on your profile','[LOGO]Dear [borrower_contact_person],<br><br>We refer to your application for joining the [application_name]. Upon reviewing your application we have noticed certain discrepancies that need to be corrected before proceeding further. <br>We request you to correct the discrepancies at the earliest. You may login to the system here.<br>sincerely,<br>Team [application_name]<br>'),('borrower_register_success','Registration Successful','[LOGO]Dear [borrower_firstname] [borrower_lastname],<br><br>We have received a registration request for this email address [signup_email]. If you have not requested a registration, please ignore this mail. <br>.<nr>If you have requested this registration, you need to confirm the email address by clicking here   [confirmation_url].<br><br>Once you have confirmed, you need to fill up your profile before you can start using the site.<br><br>We look forward to the pleasure of working with you.<br><br>Sincerely,<br><br>Team [application_name]<br>'),('change_password_admin','Your password has been changed','[LOGO]Dear [username], <br><br> your password now changed successfully <br>sincerely,<br>Team [application_name]<br>'),('change_password_borrower','Your password has been changed','[LOGO]Dear [borrower_contact_person], <br><br> your password now changed successfully <br>sincerely,<br>Team [application_name]<br>'),('change_password_copy_admin','User password has been changed','[LOGO]Dear [admin_email_label],<br><br> The following user [username] password changed successfully <br>sincerely,<br>Team [application_name]<br>'),('change_password_investor','Your password has been changed','[LOGO]Dear  [investor_firstname] [investor_lastname], <br><br> your password now changed successfully <br>sincerely,<br>Team [application_name]<br>'),('investor_bank_approved','New Bank Information Updated','[LOGO]Dear [investor_firstname] [investor_lastname],<br><br>The Bank information update that you had initiated on [application_name] has now been successfully approved.<br>sincerely,<br>Team [application_name]<br>'),('investor_deposit_approved','Approval of the Deposits Made','[LOGO]Dear <strong>[investor_firstname] [investor_lastname]</strong>,<br><br>The amount you had deposited into [application_name]s bank account is now approved. Your current balance is SGD [investor_current_balance]. <br><br>Sincerely,<br><br>Team [application_name]<br>'),('investor_deposit_unapproved','Approval of Deposits reversed','[LOGO]Dear [investor_firstname] [investor_lastname],<br><br>The approval for the deposit you had made into [application_name]s bank account has been reversed for administrative purposes. Please get in touch with our Customer Service team for more information. Your current balance is SGD [investor_current_balance]. <br>Sincerely,<br>Team [application_name]<br>'),('investor_profile_approved','Your Profile has been approved','[LOGO]<table>\r\n<tr>\r\n<td>\r\n<img src=\"http://douspeakgreen.in/media/email/logo/default/small-logo.png\"> </td>\r\n<td>Fund Yourself Now</td>\r\n</tr>\r\n<tr>\r\n<td>\r\nHello [investor_firstname] [investor_lastname], </td></tr>\r\n<tr><td><strong>Congratulations. </strong>. Your profile is now approved. You are now ready to start investing at [application_name] \r\n</td></tr>\r\n<tr><td>sincerely,</td></tr>\r\n<tr><td>Team [application_name]</td></tr>'),('investor_profile_inactive','Profile Inactive','[LOGO]Dear [investor_firstname] [investor_lastname],<br><br>We refer to your application for registering as an investor at [application_name]. We have deactivated your account for administrative reasons. Please get in touch with our Customer Service team over email for more information.<br>sincerely,<br>Team [application_name]<br>'),('investor_profile_reject','Profile Rejected','[LOGO]Dear [investor_firstname] [investor_lastname],<br><br>We refer to your application for registering as an investor at [application_name]. We are sorry to inform you that your profile has been rejected. Please get in touch with our Customer Service team over email for more information.<br>sincerely,<br>Team [application_name]<br>'),('investor_profile_return_to_investor','Changes required on your profile','[LOGO]Dear [investor_firstname] [investor_lastname],<br><br>We refer to your application for registering as an investor at [application_name]. We have noted some points that need to be clarified before your profile can be approved. <br>Please login to the system and check your profile for further information.<br>sincerely,<br>Team [application_name]<br>'),('investor_register_success','Registration Successful','[LOGO]Dear [investor_firstname] [investor_lastname],<br><br>We have received a registration request for this email address [signup_email]. If you have not requested a registration, please ignore this mail. <br>.<nr>If you have requested this registration, you need to confirm the email address by clicking here   [confirmation_url].<br><br>Once you have confirmed, you need to fill up your profile before you can start using the site.<br><br>We look forward to the pleasure of working with you.<br><br>Sincerely,<br><br>Team [application_name]<br>'),('investor_withdrawal_approved','Approval of Withdrawal Request','[LOGO]Dear [investor_firstname] [investor_lastname],<br><br>Your withdrawal request made on [withdraw_request_date] is now approved and is now processed. Your bank account will be credited soon. Please get in touch with our Customer Service team for any assistance. Your current balance is SGD [investor_current_balance]. <br>Sincerely,<br>Team [application_name]<br>'),('investor_withdrawal_unapproved','Approval of Withdrawal reversed','[LOGO]Dear [investor_firstname] [investor_lastname],<br><br>The approval for the withdrawal request you had made has been reversed for administrative purposes. Please get in touch with our Customer Service team for more information. Your current balance is SGD [investor_current_balance]. <br>Sincerely,<br>Team [application_name]<br>'),('loan_approved','Your loan application has been approved','[LOGO]Dear [borrower_contact_person],<br><br>Your loan application made on [loan_apply_date] has now been successfully approved. <br>The loan will now be displayed prominently on the loan listing screen for all the investors. You may share the details of this loan to your contacts on Social Media or through email by logging to the system and viewing the loan details. <br> sincerely,<br>Team [application_name]<br>'),('loan_bids_accepted','Loan Bid Accepted','[LOGO]Dear [investor_firstname] [investor_lastname],<br><br>Your bid for the loan [loan_number] of SGD [bid_amount] has been accepted for SGD [bid_accepted_amount]. The customer service team will get in touch with you to complete other formalities towards investing in this loan. <br>sincerely,<br>Team [application_name]<br>'),('loan_bids_by_investor','Your bid for loan','[LOGO]Dear [investor_firstname] [investor_lastname],<br><br>You bid for the loan [loan_number] has been successfully registered. The bid will be processed when the Bids are closed for this loan. You will be notified through email, when your bid is accepted<br>sincerely,<br>Team [application_name]<br>'),('loan_bids_rejected','Loan Bid Rejected','[LOGO]Dear [investor_firstname] [investor_lastname],<br><br>Your bid for the loan [loan_number]  of SGD [bid_amount] has not been accepted by the loan applicant. Please get in touch with the customer service team if you need more information <br>sincerely,<br>Team [application_name]<br>'),('loan_bid_closed','Loan Bids Closed','[LOGO]Dear [borrower_contact_person],<br><br>The bids for the loan number [loan_number] is now closed. You may now choose the bids manually or automatically as per your needs. You may contact the customer service for assistance on this at any time over email or phone<br>sincerely,<br>Team [application_name]<br>'),('loan_bid_updated','Update to your Bid','[LOGO]Dear [investor_firstname] [investor_lastname],<br><br>You bid for the loan [loan_number] has been successfully updated. The bid will be processed when the Bids are closed for this loan. You will be notified through email, when your bid is accepted<br>sincerely,<br>Team [application_name]<br>'),('loan_cancelled','Loan Cancelled','[LOGO]Dear [borrower_contact_person],<br><br>You loan application no [loan_number] has been cancelled by the administrator of [application_name]. <br>You can get in touch with the Customer Service team if you need more information.<br>sincerely,<br>Team [application_name]<br>'),('loan_disbursed','Loan Disbursed','[LOGO]Dear [borrower_contact_person],<br><br>Your loan application no [loan_number] has been successfully processed and the loan sanctioned amount SGD [loan_sanctioned_amount] less the processing fees has been deposited into your registered bank account. <br>The repayment schedule is given below for your quick reference. <br><br>[borrower_loan_repayment_schedule]<br>You will be sent reminders when the installment is falling due. <br>sincerely,<br>Team [application_name]<br>'),('loan_disbursed_investor','Loan disbursed','[LOGO] Dear [investor_firstname] [investor_lastname],<br><br>loan application no [loan_number] has been successfully processed .The investor repayment schedule is given below for your quick reference. <br><br>[investor_loan_repayment_schedule]<br>You will be sen <br>sincerely,<br>Team [application_name]<br>'),('loan_repayment_complete','Repayment Complete','[LOGO]Dear [borrower_contact_person],<br><br>Payment for your loan account number [loan_number] is now complete and your loan account has been successfully closed. <br>We thank you for using [application_name] and hope that your experience with us has been satisfactory. <br><br>Please get in touch with the customer service team if you need more information.  <br>Sincerely,<br>Team [application_name]<br>'),('loan_repayment_complete_cancelled','Repayment completion cancelled','[LOGO]Dear [borrower_contact_person],<br><br>Payment for your loan account number [loan_number] is now cancelled the completion. <br>Please get in touch with the customer service team if you need more information.  <br>Sincerely,<br>Team [application_name]<br>'),('loan_repayment_overdue_notice','Payment Overdue Notice','[LOGO]Dear [borrower_contact_person],<br><br>Payment for your loan account number [loan_number] installement number [installment_number] is due for payment on [installment_due_date] and is currently overdue<br><br>Penalty will be charged @[penalty_interest] on the overdue amount compounded daily. Additionally late payment processing fee will be charged @[penalty_fee_percent]% subject to a minimum SGD [penalty_fee_minimum].<br><br>We request you to make the payment at the earliest to avoid any further inconveniences. Please get in touch with the customer service team if you need more information.  <br>Sincerely,<br>Team [application_name]<br>'),('loan_repayment_reminder','Repayment reminder','[LOGO]Dear [borrower_contact_person],<br><br>Payment for your loan account number [loan_number] installement number [installment_number] is due for payment on [installment_due_date]. <br>The due amount will be automatically debited from your registered bank account on the due date. Please ensure that your bank account has sufficient balance to avoid any inconveniences.  <br>Sincerely,<br>Team [application_name]<br>'),('loan_return_to_borrower','Changes required in the Loan Application detail','[LOGO]Dear [borrower_contact_person],<br><br>We refer to your loan application. We have noted some points that need to be clarified before your loan can be approved. <br>Please login to the system and check the loan details for further information.<br>sincerely,<br>Team [application_name]<br>'),('loan_unsuccessful_borrower','Loan closed due to insufficient Subscription','[LOGO]Dear [borrower_contact_person],<br><br>Your loan [loan_number] is closed automatically as it is past the Bid Close Date. <br>\nThe loan has not attracted sufficient subscription and is therefore automatically cancelled. <br>\nFor more information, please get in touch with the Admin team. <br>Sincerely,<br>Team [application_name]<br>'),('loan_unsuccessful_investor','Loan closed due to insufficient Subscription','[LOGO]Dear [investor_firstname] [investor_lastname],<br><br>\nThe Loan number [loan_number] that you had bid for is now closed automatically as the bid close date is past. <br>\nSince the loan hasn\'t attracted sufficient investments, the loan stands cancelled. Your bid in this loan is also cancelled automatically and \nthe bid amount is automatically credited to your account. <br>The current balance in your account now is SGD [investor_current_balance].<br>\nPlease contact the customer service team if you need any further assistance or information. <br>Sincerely,<br>Team [application_name]<br>'),('password_wrong_borrower','Warning, unsuccessful attempts','[LOGO] Dear  [username],You have entered 3 unsuccessful  wrong password attempt. kindly send an email to admin to reset password.<br> sincerely,[application_name]'),('password_wrong_investor','Warning, unsuccessful attempts','[LOGO] Dear  [username],You have entered 3 unsuccessful  wrong password attempt. kindly send an email to admin to reset password.<br> sincerely,[application_name]'),('repayment_approved','Repayment has been processed','[LOGO]Dear [borrower_contact_person],<br><br>The repayment for the installment number [installment_number] of your loan account number [loan_number] has been successfully processed. <br>sincerely,<br>Team [application_name]<br>'),('repayment_cancelled_received_investor','Repayment debited from your account','[LOGO]Dear ainvestor_firstname] [investor_lastname],<br><br>Repayment for the installment number [installment_number] of the loan account number [loan_number] that you had invested in, has been unapprove. The installment amount has been debited from your account.<br>The current balance in your account now is SGD [investor_current_balance].<br>Please contact the customer service team if you need any further assistance or information. <br>sincerely,<br>Team [application_name]<br>'),('repayment_received_investor','Repayment received into your account','[LOGO]Dear [investor_firstname] [investor_lastname],<br><br>Repayment for the installment number [installment_number] of the loan account number [loan_number] that you had invested in, has been received and processed. The installment amount has been credited to your account.<br>The current balance in your account now is SGD [investor_current_balance].<br>Please contact the customer service team if you need any further assistance or information. <br>sincerely,<br>Team [application_name]<br>'),('repayment_unapproved','Repayment has been unapproved','[LOGO]Dear [borrower_contact_person],<br><br>The repayment for the installment number [installment_number] of your loan account number [loan_number] has been unapproved. <br>sincerely,<br>Team [application_name]<br>');
